/**
 * Clase que representa un conjunto de datos para visualizaci\xF3n.
 * Act\xFAa como una fachada que simplifica la interacci\xF3n con el DataProvider.
 */
class Dataset {
  /** Identificador opcional para el conjunto de datos. */
  public readonly id?: number;
  /** Array de objetos Dimension que describen los datos. */
  public readonly dimensions: Dimension[];
  /** Flag para habilitar o deshabilitar la funcionalidad de roll-up. */
  public readonly enableRollUp: boolean;
  /** Los datos crudos (sin procesar) del conjunto de datos. */
  public readonly rowData: RowData[];
  /** (Avanzado) Instancia del motor de procesamiento de datos subyacente. */
  public readonly dataProvider: DataProvider;
  /** Un 'Subject' de RxJS que emite 'true' cuando los datos se actualizan. */
  public readonly dataUpdated = new Subject<boolean>();

  /**
   * Aplica una configuraci\xF3n de filtros y/o roll-up al DataProvider.
   * @param config - Objeto con la configuraci\xF3n de filtros a aplicar.
   */
  public applyFilters(config: FiltersConfig): void { /* ... */ }

  /**
   * Devuelve una copia de los datos crudos originales.
   * @returns Un array de RowData.
   */
  public getRawData(): RowData[] { /* ... */ }

  /**
   * Devuelve los datos procesados actuales del DataProvider (despu\xE9s de filtros y roll-up).
   * @returns Un array de RowData procesado.
   */
  public getCurrentData(): RowData[] { /* ... */ }

  /**
   * Devuelve una copia de todas las dimensiones definidas en el Dataset.
   * @returns Un array de Dimension.
   */
  public getAllDimensions(): Dimension[] { /* ... */ }

  /**
   * Devuelve las dimensiones que est\xE1n activas (no agrupadas por rollUp).
   * @returns Un array de Dimension activas.
   */
  public getActiveDimensions(): Dimension[] { /* ... */ }

  /**
   * Obtiene la clave de datos ('key') asociada a un ID de dimensi\xF3n.
   * @param dimensionId - El ID de la dimensi\xF3n.
   * @returns La 'key' (string) correspondiente o undefined.
   */
  public getDimensionKey(dimensionId: number): string | undefined { /* ... */ }

  /**
   * Obtiene todos los valores \xFAnicos para una dimensi\xF3n espec\xEDfica.
   * @param dimensionId - El ID de la dimensi\xF3n a consultar.
   * @returns Un array de valores \xFAnicos para la dimensi\xF3n.
   */
  public getDimensionValues(dimensionId: number): (string | number)[] { /* ... */ }
}

/**
 * Interfaz que representa una dimensi\xF3n en el conjunto de datos
 */
interface Dimension {
  id: number;
  name: string;
  nameView: string;
  items: Item[];
  type?: number;
  enableMulti?: boolean;
  selected?: boolean;
}

/**
 * Interfaz que representa un \xEDtem dentro de una dimensi\xF3n
 */
interface Item {
  id: number;
  name: string;
  color?: string;
  order?: number;
  selected: boolean;
}

/**
 * Interfaz base que representa una fila de datos gen\xE9rica.
 */
interface RowData {
  [key: string]: string | number | null;
}

/**
 * Configuraci\xF3n para un filtro de dimensi\xF3n. Permite usar el id o el nombre de la dimensi\xF3n.
 */
interface DimensionFilterConfig {
  name: string | number;
  items: (string | number)[];
}

/**
 * Objeto para la configuraci\xF3n de filtros y agrupaciones (roll-up).
 */
interface FiltersConfig {
  rollUp?: (string | number)[];
  filter?: DimensionFilterConfig[];
}
